import React, { Component } from "react"
import TodoItem from "./TodoItem.js"

class TodoList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            todoItems: ["Do homework", "Do luandry"]
        }
    }

    render() {
        return (
            <div>
            <ul>
                {this.state.todoItems.map(item => <TodoItem todoContent={item} />)}
            </ul>
            </div>

        )
    }
}

export default TodoList
